function ActivityRow(props) {
   return <tr>{props.value}</tr>
}

function ActivitiesColumn(props) {
   const activities = props.activities;

   return (
       <tr>
          {activities && activities.map(activity => <ActivityRow key={activity.toString()} value={activity}/>)}
       </tr>
   );
}

export default ActivitiesColumn;
